import React from 'react';

const styles = {
    bar: {
        height: '100vh',
        width: '7%',
        backgroundColor: 'rgb(24,24,24',
        float: 'left',
        textAlign: 'center'

    },
    black: {
        backgroundColor: 'black'
    }
}

const Sidebar = () => {

    return(

        <React.Fragment>
            <div style={styles.bar}>
                <div style={styles.black}>
                <div className="w3-padding w3-jumbo w3-text-white">
                <a href='/'><i className="fa fa-home"></i></a>
                <a href='/'><i className="far fa-user"></i></a>
                </div>
                </div>
            </div>
        </React.Fragment>
    )
}
export default Sidebar
